import React from 'react'

interface forProps{
    items:{id:string, text:string}[];
}

const Messages: React.FC<forProps> = (props) => {
    return(
        <div> 
            <h4>Coming from the Message box</h4> 

               <ul> {props.items.map(ele => 
                <li> {ele.text}
                <span>{ele.id}</span>    
                </li>)}         
            </ul>
        </div>
    )
}
export default Messages;
